import { Axios } from "axios";
import React from "react";

function Index() {
  const getCategories = () => {
    Axios.get(
      `https://pixabay.com/api/?key=25540812-faf2b76d586c1787d2dd02736&q=${CATEGORY}`
    );
  };
  return (
    <div>
      {/* Button div */}
      <div>
        <button>PREV</button>
        <button>NEXT</button>
        <select>
          <option>Select category</option>
        </select>
      </div>
      {/* Img div */}
      <div></div>
      <div></div>
    </div>
  );
}

export default Index;
